import './App.css';
import MenuNav from './Componentes/MenuNav';
import Card from './Componentes/Card';
import './Componentes/Card.css'

function App() {
  return (
    <div className="App">
      <MenuNav />
      <header className="App-header">
        <Card />
      </header>
    </div>
  );
}

export default App;
